""" This module encodes the gui app icon into sourcecode 
"""

import base64
import os
import os.path
import tempfile

##The Base64 icon version as a string
icon = \
""""""


tempFile= "icon.ico"

def gettempfilename():
	icondata= base64.b64decode(icon)
	## The temp file is icon.ico
	iconfile= open(os.path.join(tempfile.gettempdir(),tempFile),"wb")
	## Extract the icon
	iconfile.write(icondata)
	return os.path.join(tempfile.gettempdir(),tempFile)
	
def removetempfile():
	os.remove(os.path.join(tempfile.gettempdir(),tempFile))
